exports=async function(bid,options){const{parseCatalogPaginate,getSelectLastOption}=await require("transcode/parse_catalog"),clientOptions={...(options&&options.clientOptions)};return parseCatalogPaginate(page=>`https://www.lacebridal.net/chapters/${bid}/${page}`,"dl.panel-chapterlist",{...options,clientOptions,pageSize:100,totalPagesRegex:html=>getSelectLastOption(html,s=>-1!==s.indexOf("\u7AE0"))?.subRegex(/value="(\d+)"/)?.intValue(),idRegex:/\/chapter\/\d+\/(?<id>\d+)/})};